            $global:assessmentSubject = $global:ASSESSMENT_SUBJECT_READING
        }
        $global:ASSESSMENT_SUBJECT_MATH {
            $global:assessmentSpecificColumnNameValue = "aMath"
            $global:assessmentSubject = $global:ASSESSMENT_SUBJECT_MATH
        }
        Default {
            # If map attribute does not match then throw error and stop execution
            $errorMessage = "Error: Template is designed to receive a specific map attribute value ('MA' or 'RD'). Value '$($DataImport.MapAttribute)' is not an option."
            Write-Error "$errorMessage"
            throw "$errorMessage"
        }
    }

    # GradeLevelLookup
    $global:GRADE_LEVEL_LOOKUP = @{}
    $global:GRADE_LEVEL_LOOKUP.Add('Kindergarten', 'uri://ed-fi.org/GradeLevelDescriptor#Kindergarten')
    $global:GRADE_LEVEL_LOOKUP.Add('One', 'uri://ed-fi.org/GradeLevelDescriptor#First grade')
