    $global:GRADE_LEVEL_LOOKUP.Add('Eight', 'uri://ed-fi.org/GradeLevelDescriptor#Eighth grade')	
    $global:GRADE_LEVEL_LOOKUP.Add('Nine', 'uri://ed-fi.org/GradeLevelDescriptor#Ninth grade')	
