    $global:ASSESSMENT_ID_LOOKUP.Add("$global:ASSESSMENT_SUBJECT_READING-$global:SCREENING_PERIODS_FALL", "FASTBRIDGE-CAT-RD-FALL-V1") | Out-Null
    $global:ASSESSMENT_ID_LOOKUP.Add("$global:ASSESSMENT_SUBJECT_READING-$global:SCREENING_PERIODS_WINTER", "FASTBRIDGE-CAT-RD-WINTER-V1") | Out-Null
