        @{ "SourceColumnName" = "Local ID"; }) | Out-Null

    $global:CUSTOM_COLUMN_MAP.Add("DI_AdministrationDate", 
        # Source Column name is a template "{screening period} {value depending of Math and Reading} Final Date" example: "Fall aMath Final Date"
        @{ "SourceColumnName" = "{0} $global:assessmentSpecificColumnNameValue Final Date"; }) | Out-Null

