    $global:CUSTOM_COLUMN_MAP.Add("DI_AssessedGradeLevel", 
        @{ "SourceColumnName" = "Grade"; }) | Out-Null

    $global:CUSTOM_COLUMN_MAP.Add("DI_StudentAssessmentId", 
        @{ "SourceColumnName" = "{0} $global:assessmentSpecificColumnNameValue Final Date" }) | Out-Null

    $global:CUSTOM_COLUMN_MAP.Add("DI_AssessmentId", 
        @{ "SourceColumnName" = ""; }) | Out-Null

