    $global:COMMON_COLUMNS_TEMPLATE = "{0} $($global:assessmentSpecificColumnNameValue) {1}"

    # Columns with Period to Period in part of the name. Template with be filled with SCREENING_PERIOD_APPLICABLE_RANGES_LOOKUP
    $global:SCREENING_PERIOD_SPECIFIC_COLUMNS = @()
