    $global:SCREENING_PERIOD_SPECIFIC_COLUMNS += "School Growth Percentile from {0}"
    $global:SCREENING_PERIOD_SPECIFIC_COLUMNS += "District Growth Percentile from {0}"
    $global:SCREENING_PERIOD_SPECIFIC_COLUMNS += "National Growth Percentile from {0}"
    $global:SCREENING_PERIOD_SPECIFIC_COLUMNS += "Growth Percentile by Start Score from {0}"

    # For each period define from-to period values. 
    # HashTable with key: screening period and value:the array of applicable ranges for the screening period in question
    $global:SCREENING_PERIOD_APPLICABLE_RANGES_LOOKUP = @{}
    $global:SCREENING_PERIOD_APPLICABLE_RANGES_LOOKUP.Add($global:SCREENING_PERIODS_FALL, @()) | Out-Null
    $global:SCREENING_PERIOD_APPLICABLE_RANGES_LOOKUP.Add($global:SCREENING_PERIODS_WINTER, 
        @(
            "Fall to Winter"            
        )
    ) | Out-Null
    $global:SCREENING_PERIOD_APPLICABLE_RANGES_LOOKUP.Add($global:SCREENING_PERIODS_SPRING, 
        @(
            "Fall to Spring",
            "Winter to Spring"
        )
    ) | Out-Null
    $global:SCREENING_PERIOD_APPLICABLE_RANGES_LOOKUP.Add($global:SCREENING_PERIODS_SP4, 
        @(
            "Fall to Screening Period 4",            
            "Winter to Screening Period 4",
            "Spring to Screening Period 4"
        )
    ) | Out-Null
    $global:SCREENING_PERIOD_APPLICABLE_RANGES_LOOKUP.Add($global:SCREENING_PERIODS_SP5, 
        @(
            "Fall to Screening Period 5",
            "Winter to Screening Period 5",
            "Spring to Screening Period 5",
            "Screening Period 4 to Screening Period 5"
        )
    ) | Out-Null

}

# Process each individual line of incoming data (the pipeline sends this one line at a time)
process {
    $currentLineNumber += 1
    $global:statistics.rowsProcessed += 1

    # Make sure we got something
    if (!$line) { Write-Error "Line $currentLineNumber does not contain any data"; return }

    # If the first line pick out all of the headers
    if ($currentLineNumber -eq 1) { 

        # We assume headers will not have commas in the names
        $headerRow = Get-ParsedRecordArray -line $line 

        # Loop thru headers to find and fix empty of duplicate headers
        for ($i = 0; $i -lt $headerRow.Count; $i++) {
            $item = $headerRow[$i]
            # $item = $item.Trim('"')

            # handle empty headers
            if (!$item) {
                $newName = "EMPTY-$i"
                Write-Warning "Found empty column at position $($i + 1). Renaming column to '$newName'."
                $item = $newName
            }
            # handle duplicate headers
            if ($global:headersLookup.contains($item)) {
                $newName = "$item-$i"
                Write-Warning "Found duplicate column name of '$item' at position $($i + 1). Renaming column to '$newName'."
                $item = $newName
            }
            $global:inputHeaders += $item            
            $global:headersLookup.Add($item, $index) | Out-Null        
        }

        # Fixed Headers
        # Order matters, output values must be extracted in this same order
        # 1 - All screening periods common columns
        $fixedHeaders = $global:COMMON_COLUMNS

        # 2 - All screening periods specific columns in the same order as SCREENING_PERIODS
        foreach ($sp in $global:SCREENING_PERIODS) {
            $fixedHeaders += $(Get-PeriodSpecificColumnNames($sp))
        }        

        # 3 - If there are custom headers add to output header line
        if ($global:CUSTOM_COLUMN_MAP.Count) {            
            $fixedHeaders += $( $global:CUSTOM_COLUMN_MAP.Keys | Sort-Object )
        }

        Write-Output $(Get-CSVLine($fixedHeaders))
        return
    }

    # In case of comma in the value, for instance StudentName: "Smith, Joe"
    $row = ConvertFrom-Csv -InputObject $line -Header $global:inputHeaders

    $errorInCurrentRow = $false
    # Loop through all periods to post assessment data for each period
    foreach ($sp in $global:SCREENING_PERIODS) {
        $orderedOutputValues = @()
        # 1 - Common columns 
        foreach ($colName in $(Get-CommonColumnNames($sp))) {
            $orderedOutputValues += $row.$colName
        }

        # 2 - Screening Period specific columns
        # Loop thru periods to be able to output all columns even 
        foreach ($innerScreeningPeriod in $global:SCREENING_PERIODS) {
            foreach ($col in $(Get-PeriodSpecificColumnNames($innerScreeningPeriod))) {
                $v = $null
                # Only add values for columns that match current screening period
                # if values do not belong to the current period output null value, because output row must always be in the same format(number of columns)
                if ($innerScreeningPeriod -eq $sp) {
                    $v = $row.$col
                }
                $orderedOutputValues += $v
            }
        }

        # Validation will tell whether or not a record has th required values needed to be posted to ODS, if not valid add line number to show in summary
        $passedValidation = $true
        $validationId = $null
        # Process custom/computed columns
        if ($global:CUSTOM_COLUMN_MAP.Count) {            
            foreach ($outColumnName in $( $global:CUSTOM_COLUMN_MAP.Keys | Sort-Object )) {
                
                $srcInfo = $global:CUSTOM_COLUMN_MAP[$outColumnName]                
              
                ### DataImport Assessment Custom Columns
                switch -Exact ($outColumnName) {
                    # StudentId
                    "DI_StudentId" {
                        $srcColName = $srcInfo.SourceColumnName
                        $stdId = Get-StudentODSId($row.$srcColName)

                        # Validation, this is a required field, if empty will be unable to post to ODS.
                        if (!$stdId) {
                            $passedValidation = $false
                            $validationId = "InvalidUserId"
                            break
                        }

                        $orderedOutputValues += $stdId
                    }

                    # Admin Date
                    "DI_AdministrationDate" {
                        # We know this Source Column name is a template, hydrate with screeningPeriod
                        $srcColName = $srcInfo.SourceColumnName -f $sp
                        $adminDate = $row.$srcColName

                        # Validation, this is a required field, if empty will be unable to post to ODS
                        if (!$adminDate) {
                            $passedValidation = $false
                            $validationId = "InvalidAdministrationDate"
                            break
                        }

                        $orderedOutputValues += $adminDate
                    }

                    # School Year
                    "DI_SchoolYear" {
                        # We know this Source Column name is a template, hydrate with screeningPeriod
                        $srcColName = $srcInfo.SourceColumnName -f $sp
                        $parsedDate = Get-ParsedDate -date $($row.$srcColName) -inputFormat "M/d/yyyy"
                        $schoolYear = $null
                        if ($parsedDate) {
                            if ($parsedDate.Month -ge 8) {
                                $schoolYear = $parsedDate.Year + 1
                            }
                            else { 
                                $schoolYear = $parsedDate.Year
                            }
                        }

                        # Validation, this is a required field, if empty will be unable to post to ODS
                        if (!$schoolYear) {
                            $passedValidation = $false
                            $validationId = "InvalidSchoolYear"
                            break
                        }

                        $orderedOutputValues += $schoolYear
                    }

                    # Grade Level
                    "DI_AssessedGradeLevel" {
                        $srcColName = $srcInfo.SourceColumnName
                        $gradeLevel = $row.$srcColName
                       
                        $orderedOutputValues += $gradeLevel.ToUpper()
                        
                    }

                    # Assessment Student Identifier
                    "DI_StudentAssessmentId" {    
                        # We know this Source Column name is a template, hydrate with screeningPeriod
                        $srcColName = $srcInfo.SourceColumnName -f $sp
                        $colAssessStudentId = $row.$srcColName

                        $AssessStudentId = Get-ParsedDate -date $colAssessStudentId -inputFormat "M/d/yyyy" -outputFormat "MMddyyyy"
                        
                        # Validation, this is a required field, if empty will be unable to post to ODS
                        if (!$assessStudentId) {
                            $passedValidation = $false
                            $validationId = "InvalidStudentAssessmentId"
                            break
                        }

                        $orderedOutputValues += $assessStudentId
                    }

                    # Assessment Identifier
                    "DI_AssessmentId" {
                        $assessmentIdentifier = $null

                        # Select AssessmentId based on Subject and Screening Period
                        $subjectAndScreeningPeriodKey = "{0}-{1}" -f $($global:assessmentSubject), $sp

                        if ($global:ASSESSMENT_ID_LOOKUP.Contains($subjectAndScreeningPeriodKey)) {
                            $assessmentIdentifier = $global:ASSESSMENT_ID_LOOKUP[$subjectAndScreeningPeriodKey]
                        }

                        # Validation, this is a required field, if empty will be unable to post to ODS
                        if (!$assessmentIdentifier) {
                            $passedValidation = $false
                            $validationId = "InvalidAssessmentId"
                            break
                        }
                        $orderedOutputValues += $assessmentIdentifier
                    }

                    "DI_ScreeningPeriod" {
                        $orderedOutputValues += $sp
                    }
    
                    "DI_RiskLevelDescriptor" {
                        # We know this Source Column name is a template, hydrate with screeningPeriod
                        $srcColName = $srcInfo.SourceColumnName -f $sp
                        $riskLevel = $row.$srcColName
                        
                        $orderedOutputValues += $riskLevel.ToUpper()
                            
                    }

                    Default {
                        # In case of no implementation for custom column add $null output to preserve output format and order
                        $orderedOutputValues += $null
                        break;
                    }
                }
            }
        }        

        # If not valid add to statistics to notify user at the end of execution and skip record and do not post current for current row this screening period to ODS
        if (!$passedValidation) {
            # Only print once per row
            if (!$errorInCurrentRow) {
                Write-Warning "Invalid record see statistics summary for details.($currentLineNumber)"
            }            
            $errorInCurrentRow = $true

            #summary will be broken down by screeningPeriods so it is easier to analyze by user
            $normalizedScreeningPeriod = Get-NormalizedScreeningPeriodName($sp)
            # Check if current screening period already added to validation if not add
            if ($global:statistics.validations[$normalizedScreeningPeriod]) {
                $spValidation = $global:statistics.validations[$normalizedScreeningPeriod]
                # Check if this validation error already added for current screening period
                if ($spValidation[$validationId]) {
                    $spValidation[$validationId] += $currentLineNumber
                }
                else {
                    $spValidation.Add($validationId, @($currentLineNumber)) | Out-Null
                }
            }
            else {
                $global:statistics.validations.Add($normalizedScreeningPeriod, @{ "$validationId" = @($currentLineNumber) }) | Out-Null
            }

            # Skip and continue to next screening period, no output generated for current screening period
            continue
        }

        # Output for current screening period
        $outline = Get-CSVLine($orderedOutputValues)
        Write-Output $outline
        $global:statistics.rowsLoaded ++    
    }

    return
}

# end of processing
end {

    Write-Information "SUMMARY: `
                    Rows Processed: $($global:statistics.rowsProcessed); `
                    Rows Loaded: $($global:statistics.rowsLoaded)"
    
    foreach ($screeningPeriod in $global:SCREENING_PERIODS) {
        $normalized = Get-NormalizedScreeningPeriodName($screeningPeriod)
        if ($global:statistics.validations[$normalized]) {
            $spStats = $global:statistics.validations[$normalized]
            Write-Information "====== SUMMARY for Screening Period: '$screeningPeriod' ======"  
            foreach ($validationId in $spStats.Keys) {
                Write-Warning "Error reason: '$validationId'"                
                Write-Information "Line number(s):"
                $lineNumbers = $spStats[$validationId]
                $errorThreshold = 50
                if ($lineNumbers.Count -gt $errorThreshold) {
                    Write-Warning "There are $($lineNumbers.Count) lines with errors. Will only print the first $errorThreshold line numbers where errors ocurred."
                    $lineNumbers = $lineNumbers[0..$($errorThreshold - 1)]
                }
                Write-Warning "$([string]::Join(",",$lineNumbers))"
            }
        }
    }   


}
